  `user_code` varchar(100) DEFAULT NULL,
  `p1` int(11) NOT NULL DEFAULT '0' COMMENT '上级公会ID',
  `p2` int(11) NOT NULL DEFAULT '0' COMMENT '上上级公会ID',
  `token` varchar(32) NOT NULL DEFAULT '0',
  `modules` varchar(500) DEFAULT NULL,
  `apps` varchar(500) DEFAULT NULL,
  `nnb` float NOT NULL,
  `nnb_lock` int(1) NOT NULL COMMENT '牛币锁 1.锁定',
  `nnb_last_time` int(11) NOT NULL,
  `img` varchar(200) NOT NULL COMMENT ' 公会icon',
  `guild_name` varchar(200) NOT NULL COMMENT '公会对外名称',
  `money` float DEFAULT '0' COMMENT '商会余额',
  `money_lock` int(1) DEFAULT NULL COMMENT '锁 1.锁定',
  `money_last_time` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `user_code` (`user_code`),
  KEY `user_code_2` (`user_code`),
  KEY `group_id` (`group_id`)
) ENGINE=InnoDB AUTO_INCREMENT=615 DEFAULT CHARSET=utf8;

